import React from "react";
import { BsFillCartFill } from "react-icons";

const NavBar = () => {
   return (
      <nav className="navbar bg-danger text-white">
         <div className="container">
            <span>ReactMeals</span>
            <div>
               <BsFillCartFill />
            </div>
         </div>
      </nav>
   );
};

export default NavBar;
